import { Link } from "react-router-dom";
import "./NavBar.css";

export default function NavBar({ setPage }) {
  function handleChange(e) {
    setPage(e.target.name);
  }

  return (
    <div className="navDiv">
      <div className="homeBtnDiv">
        <button name="null" onClick={handleChange}>
          Home
        </button>
      </div>
      <div className="buttonDiv">
        <button name="index" onClick={handleChange}>
          See All Articles
        </button>
        &nbsp; | &nbsp;
        <a onClick={handleChange}>Home</a>
        &nbsp; | &nbsp;
        <Link
          to="/signup"
          style={{
            textDecoration: "none",
            border: "1px solid gray",
            padding: "0.5rem 1rem",
            backgroundColor: "wheat",
            color: "#333",
          }}
        >
          Sign Up
        </Link>
        <Link
          to="/login"
          style={{
            textDecoration: "none",
            border: "1px solid gray",
            padding: "0.5rem 1rem",
            backgroundColor: "whitesmoke",
            color: "#333",
          }}
        >
          Login
        </Link>
      </div>
    </div>
  );
}
